<script>
// event listener
if (window.addEventListener) {
	document.body.addEventListener('mousemove', muevemouse, false);
	document.body.addEventListener('mousedown', abajomouse, false);
	document.body.addEventListener('mouseup', arribamouse, false);
	document.body.addEventListener('touchmove', muevetouch, false);
	document.body.addEventListener('touchstart', iniciatouch, false);
	document.body.addEventListener('touchend', fintouch, false);
} else {
	document.body.onmousemove = muevemouse;
	document.body.onmousedown = abajomouse;
	document.body.onmouseup = arribamouse;
	document.body.ontouchmove = muevetouch;
	document.body.ontouchstart = iniciatouch;
	document.body.ontouchend = fintouch;
	
}
function abajomouse(e) {	hundido = 1;
    if(e.target.id!=undefined){
	    ventana(e.target.id, e);
    }
}	
function arribamouse(e) {	hundido = 0;}	
function iniciatouch(e){	hundido = 1;
    if(e.target.id!=undefined){
	    ventana(e.target.id, e);
    }
}
function fintouch(e){	    hundido = 0;}
// muevetouch
function muevetouch(e){
	var touch = e.touches[0];	var px = touch.pageX - izquierda;    var py = touch.pageY - arriba;
 	if (e.touches.length >= 2) {
		//e.preventDefault();
		return;
	}
    if(e.target.id!=undefined){
	    ventana(e.target.id, e);
      }
	e.preventDefault();
}
//mouse mueve 
function muevemouse(e) {
    e = e || window.event;    
    if(e.target.id!=undefined){
	    ventana(e.target.id, e);
    }
}
function ventana(punto, evento){
	const elemento = document.getElementById(punto);
	if(elemento && elemento.dataset.codigo!=undefined){
		codigo = elemento.dataset.codigo;
		lat = -elemento.dataset.lat;
		lng = elemento.dataset.lng;
		oficina = elemento.dataset.oficina;	
		canal = elemento.dataset.canal;
		zona = elemento.dataset.zona;
		ccostos = elemento.dataset.ccostos;
		direccion = elemento.dataset.direccion;
		nombre = elemento.dataset.nombre;
		horario1 = elemento.dataset.horario1;
		horario2 = elemento.dataset.horario2;
		horario3 = elemento.dataset.horario3;
		horario4 = elemento.dataset.horario4;
		const datosDiv = document.getElementById("datos");
		datosDiv.innerHTML = `<div><strong>${nombre}</strong></div><div>Cdigo: ${codigo}</div><div>Oficina: ${oficina}</div><div>Canal: ${canal}</div><div>Zona: ${zona}</div><div>Centro de Costos: ${ccostos}</div><div>Direccin: ${direccion}</div><div>Horarios:</div><ul><li>Lunes a Jueves: ${horario1}</li><li>Lunes a Jueves: ${horario2}</li><li>Viernes y Sbado: ${horario3}</li><li>Domingo y Festivos: ${horario4}</li></ul>`;
		datosDiv.style.display = 'block';
		
		// Posicionar la ventana
		if(evento){
			let x = evento.clientX || evento.pageX || 0;
			let y = evento.clientY || evento.pageY || 0;
			
			// Dar tiempo para que el div se renderice
			setTimeout(() => {
				const ancho = datosDiv.offsetWidth || 280;
				const alto = datosDiv.offsetHeight || 200;
				const margen = 10;
				const ventanaWidth = window.innerWidth;
				const ventanaHeight = window.innerHeight;
				
				let posX = x + margen;
				let posY = y + margen;
				
				// Ajustar si se sale por la derecha
				if(posX + ancho > ventanaWidth){
					posX = x - ancho - margen;
				}
				
				// Ajustar si se sale por abajo
				if(posY + alto > ventanaHeight){
					posY = y - alto - margen;
				}
				
				// Asegurar que no salga por arriba o izquierda
				if(posX < 0) posX = margen;
				if(posY < 0) posY = margen;
				
				datosDiv.style.left = posX + 'px';
				datosDiv.style.top = posY + 'px';
			}, 0);
		}
	}
}
window.onload=panel();
//window.addEventListener('resize', function (event) {panel();});
function panel() {
	ancho = Math.max(document.documentElement.clientWidth,  window.innerWidth);
	alto  = Math.max(document.documentElement.clientHeight, window.innerHeight)-16; 
	if (ancho > alto) { lado = alto; } else { lado = ancho; }
	document.getElementById('mapa').setAttribute('style', 'background-color:  rgb(169,239,255); width:' + lado + 'px;height:' + lado + 'px;');
}
